import React from "react";
import styled from "styled-components";

export const SwiperContainer = styled.div`
`;

export const ImgWrap = styled.div `
    max-width: 555px;
    height: 100%;
`

export const Img = styled.img `
    width:100%;
    margin: 0 0 10px 0;
    padding-right: 0;
    @media screen and (max-width: 768px) {
        width:75%;
        margin: 10px;
    }
`
